INSERT INTO `blog_article_detail` VALUES (1, 1, '\n我告诉你我喜欢你\n\n并不是一定要和你在一起\n\n只是希望今后的你\n\n在遭遇人生低谷的时候，不要灰心\n\n至少曾经有人被你的魅力所吸引\n\n曾经是，以后也会是\n\n永远感恩那些莫名的喜欢\n\n诚挚的爱，深情的拥抱，和善意\n\n这是人与人之间最深刻的关系\n\n\n\n那些连说话都轻声细语\n\n随时能注意到你情绪变化的人\n\n才是人间宝藏\n\n\n\n直到后来才知道\n\n原来人真的会因为遇见了某一个人\n\n就觉得世界万物都温柔\n\n\n\n晚风轻踩着云朵\n\n月亮在贩售快乐，你从银河背后靠近我\n\n我与星辉一同为你赴约\n\n\n\n希望我们都是苦尽甘来的人\n\n愿殊途同归时\n\n你能与我讲讲来时的路\n\n山野万里，我你是藏在星星里的温柔\n\n山野万里，你是我写在影子里的孤寂\n\n山野万里，你是我遗落人间的温柔\n\n山野万里，你是我百读不厌的诗，翰墨飘香，沁人心脾，每一个韵脚里，都是相思；每一个平仄处，都溢满欢喜\n\n山野万里，你是我甘之如饴的茶，茶烟袅袅，茶香细细，每一层回甘里，都是余韵；每一片叶子里，都潜藏情意\n\n山野万里，你是我安之若素的时光，春水更替，云水潇湘，岁月更改了我们的容颜，却从未改变初时的心境，你若安好，世事无伤\n\n山野万里，你是我藏在微风里的欢喜\n\n我想把所有美好都给你\n\n你值得，我也愿意', '2022-02-28 10:37:50', '2022-02-28 10:37:50');
